import React, { Component } from "react"
import DogInfo from "./DogInfo"

export default class Dog extends Component {
    constructor() {
        super()
        this.state = {
            allPups: []
        }
    }


    componentDidMount() {
        fetch("http://localhost:3000/pups")
            .then(resp => resp.json())
            .then(pups => {
                this.setState({ allPups: pups })
            })
    }

    handleDogInfo = (event) => {
        console.log("hey")
    }

    render() {
        return (
            <React.Fragment>
                {this.state.allPups.map((pup) => (
                    <span onClick={this.handleDogInfo} key={pup.id}>{pup.name}</span>
                ))}
            </React.Fragment>
        )
    }
}
